import React from 'react';

import home from '../assets/home.png';
import game_icon from '../assets/game_icon.png';
import automobiles from '../assets/automobiles.png';
import sports from '../assets/sports.png';
import entertainment from '../assets/entertainment.png';
import tech from '../assets/tech.png';
import music from '../assets/music.png';
import blogs from '../assets/blogs.png';
import SidebarComponents from './SidebarComponents';
import pew from '../assets/pew.jpg'
import simon from '../assets/simon.png'
import tom from '../assets/tom.png'
import megan from '../assets/megan.png'
import cameron from '../assets/cameron.png'

const Sidebar = () => {
  return (
    <div className='  w-64 bg-white py-4 px-2 h-screen'>
      <div className='flex-col bg-slate-400'>
        <div className="flex-col items-center">
          
          <SidebarComponents icon={home} label="Home" />
          <SidebarComponents icon={game_icon} label="Gaming" />
      <SidebarComponents icon={automobiles} label="Automobiles" />
      <SidebarComponents icon={sports} label="Sports" />
      <SidebarComponents icon={entertainment} label="Entertainment" />
      <SidebarComponents icon={tech} label="Technology" />
      <SidebarComponents icon={music} label="Music" />
      <SidebarComponents icon={blogs} label="Blogs" />
          
          <hr />
        </div>
        <div className="subscriber-list">
            <span>Subscriptions</span>
        <div className="side-link-item">
            <img src={pew} alt="Blogs" />
            <span>Pewdipie</span>
          </div>
          <div className="side-link-item">
            <img src={blogs} alt="Blogs" />
            <span>Blogs</span>
          </div>
          <div className="side-link-item">
            <img src={blogs} alt="Blogs" />
            <span>Blogs</span>
          </div>
          <div className="side-link-item">
            <img src={blogs} alt="Blogs" />
            <span>Blogs</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
